import React from "react";
import Data from './colleges.json'
import Image from "./images/college_02.jpg"



const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {

            return (
              <>
             
               <div className="card-container ">
               <img className="background" src="" alt="img"/>
                  
               </div>
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
